webpackJsonp([0xe489934030fa],{1474:function(e,t){e.exports={data:{site:{siteMetadata:{title:"Psyked.co.uk",author:"James Ford"}},markdownRemark:{id:"/Users/James/Repositories/portfolio-2018/src/posts/time-for-a-blog-refresh/index.md absPath of file >>> MarkdownRemark",html:'<p>Blogsessive has a really nice post on "20 Free Corporate Wordpress Themes", over at <a href="http://blogsessive.com/blogging-tips/20-corporate-free-wordpress-themes/">http://blogsessive.com/blogging-tips/20-corporate-free-wordpress-themes/</a>.</p>\n<p>A couple of my favourates are the <strong>Modern </strong>and <strong>Corporate Sandbox</strong>, but <strong>Basic</strong>, <strong>Deadwood Lite</strong> and <strong>Natural Power </strong>also have a nice flair.  It\'s been a while since my last theme update, and a few bugs have been cropping up so I thought it might be a good time to update the theme - maybe even make it something for the new year!</p>\n<h3>Modern</h3>\n<a href="http://www.ulfpettersson.se/design/modern/" target="_blank"><img class="alignnone size-full wp-image-446" title="modern" src="http://uploads.psyked.co.uk/2008/12/modern.jpg" alt="" width="499" height="343"></a>\n<h3>Basic</h3>\n<a href="http://www.themelab.com/free-wordpress-themes/" target="_blank"><img class="alignnone size-full wp-image-447" title="basic" src="http://uploads.psyked.co.uk/2008/12/basic.jpg" alt="" width="499" height="343"></a>\n<h3>Corporate Sandbox</h3>\n<a href="http://rubiqube.com/corporate-sandbox/"><img class="alignnone size-full wp-image-448" title="corporate-sandbox" src="http://uploads.psyked.co.uk/2008/12/corporate-sandbox.jpg" alt="" width="499" height="343"></a>\n<h3>Deadwood Lite</h3>\n<a href="http://graphpaperpress.com/2008/01/05/deadwood-lite/"><img class="alignnone size-full wp-image-449" title="deadwood-lite" src="http://uploads.psyked.co.uk/2008/12/deadwood-lite.jpg" alt="" width="499" height="343"></a>\n<h3>Natural Power</h3>\n<a href="http://xfep.com/wordpress/wordpress-theme-natural-power/"><img class="alignnone size-full wp-image-450" title="natural-power" src="http://uploads.psyked.co.uk/2008/12/natural-power.jpg" alt="" width="499" height="343"></a>\n<p>You can see a more complete list of Themes at <a href="http://blogsessive.com/blogging-tips/20-corporate-free-wordpress-themes/">http://blogsessive.com/blogging-tips/20-corporate-free-wordpress-themes/</a>.</p>',frontmatter:{title:"Time for a blog refresh...",date:"December 09, 2008",tags:["wordpress","wordpress-themes"]}}},pathContext:{}}}});
